
# Error messages flow store
flowStoreProxy_keyViolationError = Et eller flere af de unikke felter { navn, nummer } er allerede oprettet i flow store.
flowStoreProxy_dataValidationError = De udfyldte felter for\u00E5rsagede en data valideringsfejl i flow store.

flowStoreProxy_notFoundError = Kunne ikke finde det ønskede element i flow store.
flowStoreProxy_conflictError = Kunne ikke opdatere elementet. Redigerings konflikt i flow store.
flowStoreProxy_preconditionFailedError = Et af de refererede objekter eksisterer ikke l\u00E6ngere i flow store.
flowStoreProxy_modelMapperInvalidFieldValue = Tomt argument medgivet til flows store.

flowStoreProxy_generalServerError = Der opstod en fejl i kommunikationen med flow store.

# Error messages log store
logStoreProxy_notFoundError = Kunne ikke finde det ønskede element i log store.
logStoreProxy_generalServerError = Der opstod en fejl i kommunikationen med log store.

